BEGIN TRANSACTION;
CREATE TABLE WIDNR_Stocking_Data (id INTEGER PRIMARY KEY AUTOINCREMENT UNIQUE, year INTEGER, source TEXT, stocked_water_body_name TEXT, local_waterbody_name TEXT, species TEXT, strain TEXT, Latitude REAL DEFAULT NULL, Longitude REAL DEFAULT NULL, age_class TEXT, nbr_stocked INTEGER, avg_len_inches REAL);
CREATE VIEW "Musky Data" AS SELECT *
FROM WIDNR_STOCKING_DATA
WHERE species LIKE '%MUSK%';
DELETE FROM "sqlite_sequence";
COMMIT;
